import logo from "./logo.svg";
import "./App.css";
import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState(null);

  const nums = [1, 2, 3, 4, 5];

  useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  let i = 0;
  var number = 0;
  setInterval(() => {
    i++;
    number = nums[i % 5];
  }, 2000);

  useEffect(() => {
    console.log(number);
  }, [number]);

  return (
    <div className="App">
      <header className="App-header">
        <div>{number}</div>
        <img src={logo} className="App-logo" alt="logo" />

        <p>{}</p>
        <img src={!data ? null : `${data[0].image}`} />
      </header>
    </div>
  );
}

export default App;
